import React from 'react'

export const TaskRow = props => (
    <tr key={props.task.name}>
        <td>{props.task.name}</td>
        <td>
            <input 
            type="checkbox" 
            checked={props.task.completed}
            onChange={()=> props.toogleTask(props.toogleTask)}
            />

        </td>
    </tr>
);
